const h1 = document.getElementById("main");
const colorArray = [
  "#FF6633",
  "#FFB399",
  "#FF33FF",
  "#FFFF99",
  "#00B3E6",
  "#E6B333",
  "#3366E6",
  "#999966",
  "#809980",
  "#E6FF80",
  "#1AFF33",
  "#999933",
  "#FF3380",
  "#CCCC00",
  "#66E64D",
  "#4D80CC",
  "#FF4D4D",
  "#99E6E6",
  "#6666FF",
  "#33FFBD",
  "#33FF57",
  "#D1FF33",
];
setInterval(() => {
  let idx = Math.floor(Math.random() * colorArray.length);
  h1.style.color = colorArray[idx];
  h1.style.textShadow = `0 1rem 3rem ${colorArray[idx]}`;
  h1.style.backgroundColor =
    colorArray[idx + Math.floor(Math.random() * colorArray.length)];
}, 2000);
